import React from 'react';
import DatePickerComponent from '../components/CalendarComponent';
import '../styles/styles.css';

const Dates = () => {
  return (
    <div className="profile-container">
      <h1>Dates Page</h1>
      <DatePickerComponent />
    </div>
  );
};

export default Dates;
